import './App.css';

function App() {
  return (
    <div className="App">
      <video className='bg-video' autoPlay loop muted type="video/mp4">
        <source src="/images/canoe-video.mp4" />
        Sorry this video is unavailable
      </video>
    </div>
  );
}

export default App;
